(4, 21, '<p><b style=\"mso-bidi-font-weight:normal\"><i><span style=\"font-size:14.0pt;line-height:120%;font-family:Mangal;mso-ascii-font-family:\r\nMangal;mso-fareast-font-family:SimSun;mso-fareast-theme-font:minor-fareast;\r\nmso-hansi-font-family:Mangal;color:#984806;mso-themecolor:accent6;mso-themeshade:\r\n128;mso-ansi-language:EN-US;mso-fareast-language:EN-US;mso-bidi-language:HI\">The Powerful Nourishment for Physical &amp; Mental Health</span></i></b></p>\r\n\r\n<p>Alexis TruFit is a Scientific and clinically proven ingredient advanced formulation and Alexis TruFit results 18.6% improvement of working memory capacity and 12.9% improvement of memory reaction time.&nbsp; Alexis TruFit contains natural phyto-chemicals that help healthy Cell and Bone health &amp; development, special during rapid growth.</p>\r\n\r\n<p>Benefits &ndash;</p>\r\n\r\n<ul>\r\n	<li>Benefit for Memory &amp; Brain</li>\r\n	<li>Essential for Healthy Skin &amp; Hair Growth</li>\r\n	<li>Children physical &amp; mental growth &amp; bone health</li>\r\n	<li>Eye &amp; Vision Health</li>\r\n	<li>Improve Brain Function &amp; Intelligence</li>\r\n	<li>Stop Hair thinning, Hair Loss &amp; Anti Dandruff</li>\r\n</ul>\r\n', 'The Powerful Nourishment for Physical &amp; Mental Health Alexis TruFit is a Scientific and clinically proven ingredient advanced formulation and Alexis TruFit results 18.6% improvement of working memory capacity and 12.9% improvement of memory reaction time.  Alexis TruFit contains natural phyto-chemicals that help healthy Cell and Bone health &amp; development, special during rapid growth. Benefits – Benefit for Memory &amp; Brain Essential for Healthy Skin &amp; Hair Growth Children physical &amp; mental growth &amp; bone health Eye &amp; Vision Health Improve Brain Function &amp; Intelligence Stop Hair thinning, Hair Loss &amp; Anti Dandruff'),
