(13, 18, '<h1 style=\"text-align: center;\"><strong>Company Disclaimer</strong></h1>\r\n\r\n<h4 style=\"text-align: justify;\">&nbsp;</h4>\r\n\r\n<h4 style=\"text-align: justify;\">Bioalexis Trading India Private Limited is an Indian direct-selling company. The company sells its products through direct selling distributors. Any Indian citizen who has crossed the age of 18 years can apply to become a direct seller of the company&#39;s products.</h4>\r\n\r\n<h4 style=\"text-align: justify;\">The company does not charge any kind of registration fee for becoming a direct seller. The company does not make you an agent, nor does it give you any kind of fixed salary. You can start a business by simply becoming an independent distributor of the company&#39;s products. According to the business plan of the company, you can earn money by selling these products.</h4>\r\n\r\n<h4 style=\"text-align: justify;\">Our company does not take any responsibility for any promises made by the direct seller. You can buy products from the company&#39;s website and get the by invoice for your purchased<br />\r\nproducts, do not accept the product without the bill.</h4>\r\n\r\n<h4 style=\"text-align: justify;\">&nbsp;</h4>\r\n\r\n<h4 style=\"text-align: justify;\">बायोएलेक्सिस ट्रेडिंग इंडिया प्राइवेट लिमिटेड एक भारतीय डायरेक्ट सेलिंग कंपनी है. कंपनी डायरेक्ट सेलिंग वितरकों के जरिए अपने उत्पाद बेचती है. कोई भी भारतीय नागरिक जो 18 वर्ष की आयु पार कर चुका है, कंपनी के उत्पादों का प्रत्यक्ष विक्रेता बनने के लिए आवेदन कर सकता है. प्रत्यक्ष विक्रेता बनने के लिए कंपनी किसी भी प्रकार का कोई रजिस्ट्रेशन शुल्क नहीं लेती है.</h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4 style=\"text-align: justify;\">कंपनी आपको कोई एजेंट नहीं बनाती है, और ना ही आपको किसी भी तरह का निश्चित वेतन देती है. आप बस कंपनी के उत्पादों के एक स्वतंत्र वितरक बनकर एक व्यवसाय शुरू कर सकते हैं. कंपनी के बिजनेस प्लान के मुताबिक आप इन उत्पादों को बेचकर पैसे कमा सकते हैं.</h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4 style=\"text-align: justify;\">प्रत्यक्ष विक्रेता द्वारा किये गए किसी भी वादे के लिए हमारी कंपनी कोई जिम्मेदारी नहीं लेती है आप कंपनी की वेबसाइट से उत्पाद खरीद सकते हैं और अपनी खरीदी गयी उत्पादों का इनवॉइस प्राप्त कर सकते हैं, बिना इनवॉइस के उत्पाद स्वीकार ना करें.</h4>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<div class=\"tw-flex tw-justify-between text-danger \">\r\n<ol>\r\n	<li>\r\n	<p>No Joining Fees</p>\r\n	</li>\r\n	<li>\r\n	<p>No Minimal Purchase</p>\r\n	</li>\r\n	<li>\r\n	<p>कमीशन केवल उत्पादों को बिक्री करने पर मिलेगा</p>\r\n	</li>\r\n</ol>\r\n</div>\r\n', 'Company Disclaimer   Bioalexis Trading India Private Limited is an Indian direct-selling company. The company sells its products through direct selling distributors. Any Indian citizen who has crossed the age of 18 years can apply to become a direct seller of the company&#039;s products. The company does not charge any kind of registration fee for becoming a direct seller. The company does not make you an agent, nor does it give you any kind of fixed salary. You can start a business by simply becoming an independent distributor of the company&#039;s products. According to the business plan of the company, you can earn money by selling these products. Our company does not take any responsibility for any promises made by the direct seller. You can buy products from the company&#039;s website and get the by invoice for your purchased products, do not accept the product without the bill.   बायोएलेक्सिस ट्रेडिंग इंडिया प्राइवेट लिमिटेड एक भारतीय डायरेक्ट सेलिंग कंपनी है. कंपनी डायरेक्ट सेलिंग वितरकों के जरिए अपने उत्पाद बेचती है. कोई भी भारतीय नागरिक जो 18 वर्ष की आयु पार कर चुका है, कंपनी के उत्पादों का प्रत्यक्ष विक्रेता बनने के लिए आवेदन कर सकता है. प्रत्यक्ष विक्रेता बनने के लिए कंपनी किसी भी प्रकार का कोई रजिस्ट्रेशन शुल्क नहीं लेती है.   कंपनी आपको कोई एजेंट नहीं बनाती है, और ना ही आपको किसी भी तरह का निश्चित वेतन देती है. आप बस कंपनी के उत्पादों के एक स्वतंत्र वितरक बनकर एक व्यवसाय शुरू कर सकते हैं. कंपनी के बिजनेस प्लान के मुताबिक आप इन उत्पादों को बेचकर पैसे कमा सकते हैं.   प्रत्यक्ष विक्रेता द्वारा किये गए किसी भी वादे के लिए हमारी कंपनी कोई जिम्मेदारी नहीं लेती है आप कंपनी की वेबसाइट से उत्पाद खरीद सकते हैं और अपनी खरीदी गयी उत्पादों का इनवॉइस प्राप्त कर सकते हैं, बिना इनवॉइस के उत्पाद स्वीकार ना करें.   No Joining Fees No Minimal Purchase कमीशन केवल उत्पादों को बिक्री करने पर मिलेगा'),
