(15, 52, 'a:2:{i:0;a:4:{s:4:\"name\";s:20:\"RGVlcGFrIERldmFuZ2Fu\";s:11:\"designation\";s:12:\"RGlyZWN0b3I=\";s:3:\"bio\";s:1320:\"\";s:5:\"image\";s:28:\"OmRlZXBha19kZXdhbmdhbi5qcGc=\";}i:1;a:4:{s:4:\"name\";s:16:\"VGFydW4gWWFkYXY=\";s:11:\"designation\";s:12:\"RGlyZWN0b3I=\";s:3:\"bio\";s:1724:\"\";s:5:\"image\";s:24:\"OnRhcnVuX3lhZGF2LmpwZw==\";}}', 'Deepak Devangan Director Born and raised in Bemetara district in c.g. Then after he came to Raipur city in search for a job and he then got an opportunity as Direct selling and worked in national as well as international platform where he met two other pillars of Bioalexis. His impressive career has been built on solid foundations of Dedication to work; he has 13 years of experience in Networking Marketing industry. He became highly successful before instituting BIOALEXIS.Mr. Deepak&#039;s is an extraordinary achiever in Networking Business, he is a good speaker and trainer also. He is well known for his energy 24*7 work ethic. Mostly overseeing administrative operations of the company. With an entrepreneurial spirit and dynamic leadership, he is passionate about helping others reach their potential, and his uncompromising attitude is reflected in the fulfillment of dreams. Motto is to make Bioalexis company India&#039;s leading Direct selling company. Tarun Yadav Director Born and Raised in District Rajnandgaon.C.G. He started his career as a medical representative in a pharmaceutical company in India. He is very optimistic and extremely positive, Forward thinking and focused, loves the possibilities that life might bring. To fulfill the dreams, he started to work in MLM company in India as well as international platform. A medical representative turned into Entrepreneur. With over 13year of extreme experience as Network Leader his Vision as a director to unleash the entrepreneur in people&#039;s. Intended to provide a solid and trustworthy direct selling platform to their customers and distributors he founded BIOALEXIS with partners, where the distributors and customers can fulfill their desires and need. He believes in maintaining a relationship-oriented foundation grounded in ethical principles. He cares about the success of each individual Distributors because he thinks that Distributors are the most important part of what we do as a team. Overseeing Research and Products development in the bioalexis, although Mr. Tarun Yadav enjoys the analytical aspect of his duties. His mission is to make Bioalexis company a Billion-dollar company by creating more and more Billionaires in the company.'),
