(59, 21, '<p style=\"margin-left:12.0pt;\"><strong>In our formulation, we used herbs extracts in appropriate quantity which is mentioned on the label.</strong><br />\r\n<br />\r\n&bull; Used higher concentrated pure and standardized herbal extracts<br />\r\n&bull; Product formulated by qualified and experienced Ayurveda Doctor.<br />\r\n&bull; No added synthetic colors, chemicals, and artificial flavoring agents.<br />\r\n&bull; Efficacy has been already tested and proved during clinical trials.<br />\r\n&bull; Zero side effects<br />\r\n&bull; GMP Certified &amp; USFDA Registered Manufacturing Unit.<br />\r\n&bull; The product is manufactured at KVIC sponsored Manufacturing Unit (Govt of India).<br />\r\n<br />\r\n<strong>Note: Instructions for Diet, Restrictions, method of use and precautions:</strong><br />\r\n<br />\r\n&bull; Consume only light, healthy, nutritious food, fresh fruits, &amp; salads.<br />\r\n&bull; Drink plenty of water, home-made fresh juices.<br />\r\n&bull; Do exercise daily for about 30-45 minutes.<br />\r\n&bull; Improve your sleep quality.<br />\r\n&bull; Decrease or avoid the amount of highly spicy, salty, oily, sweet food.<br />\r\n&bull; Decrease the intake of excess tea, coffee, cold drinks, soft drinks, and other carbonated beverages.<br />\r\n&bull; Avoid the addiction, if any.<br />\r\n<br />\r\n<strong>Dosage : 1-2 capsule twice a day or as directed by Physician.<br />\r\noil: Massage over the effected area twice a day.</strong></p>\r\n', 'In our formulation, we used herbs extracts in appropriate quantity which is mentioned on the label. • Used higher concentrated pure and standardized herbal extracts • Product formulated by qualified and experienced Ayurveda Doctor. • No added synthetic colors, chemicals, and artificial flavoring agents. • Efficacy has been already tested and proved during clinical trials. • Zero side effects • GMP Certified &amp; USFDA Registered Manufacturing Unit. • The product is manufactured at KVIC sponsored Manufacturing Unit (Govt of India). Note: Instructions for Diet, Restrictions, method of use and precautions: • Consume only light, healthy, nutritious food, fresh fruits, &amp; salads. • Drink plenty of water, home-made fresh juices. • Do exercise daily for about 30-45 minutes. • Improve your sleep quality. • Decrease or avoid the amount of highly spicy, salty, oily, sweet food. • Decrease the intake of excess tea, coffee, cold drinks, soft drinks, and other carbonated beverages. • Avoid the addiction, if any. Dosage : 1-2 capsule twice a day or as directed by Physician. oil: Massage over the effected area twice a day.'),
