(73, 28, '<p><strong>GOA TOUR ACHIEVERS</strong><br />\r\nRAKESH KANWAR<br />\r\nVIJAY KUMAR LAHARI<br />\r\nDOMENDRA MARKANDE<br />\r\nDURGA KURRE<br />\r\nNARAYAN PRASAD TURKANE<br />\r\nDR. TEN SINGH NAG<br />\r\nTARUN KUMAR SAHU<br />\r\nSUREKHA DHIVAR<br />\r\nN.P. TURKANE SIR FAMILY<br />\r\nRAVI NARAYAN SAY<br />\r\nITESH KUMAR SAHU<br />\r\nRAVINDRA YADU<br />\r\nOMESHWARI YADAV (MOHAN YADAV)<br />\r\nJAYANTI DEWANGAN (DHANANJAY DEWANGAN<br />\r\nHEMANT TARAM<br />\r\nRAMESH KUMAR KASHYAP<br />\r\nHEERALAL BELGAYA<br />\r\nDEEPANJALI NAG (MEERA NAG)<br />\r\nPANCH KUMAR SAHU<br />\r\nRAGHUVEER BHANWAR<br />\r\nDEVA LAHARI<br />\r\nVERSHA SINGH<br />\r\nNEERAJ MAM<br />\r\nTRILOCHNI SAHU<br />\r\nRISHI HIRWANI<br />\r\nPRASHANT HARPAL<br />\r\nRICHA PATRA<br />\r\nAJAY SINGH LAHARI<br />\r\nMAUNEE DEWANGAN<br />\r\nPRATIBHA VERMA<br />\r\nLALITA BELGAYA<br />\r\nSANKHA BAI<br />\r\nBAMLESHWARI DHRUW<br />\r\nSONADHAR SHANK<br />\r\nSUNITA SAMRATH / RAJKUMAR SAMRATH<br />\r\nBHAGESHWARI NAG<br />\r\nNAVSHEELA NAYAK<br />\r\nRAJKUMARI PATEL<br />\r\nKAMAL DAS MANIKPURI<br />\r\nCHANDRA PRAKASH DANDEKAR<br />\r\nMANISHA YADU<br />\r\nROSHNI BHAWAR<br />\r\nPRASHANT YADAV<br />\r\nTIJRAM LAHARI<br />\r\nVEDVATI PATRA<br />\r\nHEMLATA SINGH<br />\r\nHEMIN LASEL<br />\r\nJAGDISH LASEL<br />\r\nRAJKUMARI KUMETI<br />\r\nCHUNNI RAWTE<br />\r\nHARIKIRTAN YADAV<br />\r\nSEJAL NAG<br />\r\nDEEPTI PAIKRA<br />\r\nANJANI PATEL<br />\r\nMAMTA SINGH<br />\r\nGHAN SHYAM PATRA<br />\r\nDURGESHWARI NAVRANGE<br />\r\nSAMBHOONATH DEHARI<br />\r\nRISHI KUMAR<br />\r\nDEEPANJALI NAG<br />\r\nDINESH NIRMALKAR<br />\r\nROHIT DEWANGAN<br />\r\nMAMTA THAKUR<br />\r\nJITANSHU DHRUW<br />\r\nSEVANTIN BAI TARAM<br />\r\nMANKUVAR KOLA<br />\r\nGIRENDRA SUDHAKAR<br />\r\nRAVINDRA LAHARE<br />\r\nGAJENDRA YADAV<br />\r\nSHIV DAYAL SINGH<br />\r\nNAVEEN KHOBRAGADE<br />\r\nTARUN LATA SHANKH<br />\r\nVIMLA THAKUR / NARAYAN THAKUR<br />\r\nCHHAGAN LAL TARAM<br />\r\nNAG SIR FAMILY<br />\r\nPRABHA SINGH<br />\r\nMANIRAM SAHU<br />\r\nNARENDRA BHARADWAJ<br />\r\nMR.YASHWANT KHUTE SIR<br />\r\nPRITESH DASHHARE<br />\r\nRAMA LASEL</p>\r\n', 'GOA TOUR ACHIEVERS RAKESH KANWAR VIJAY KUMAR LAHARI DOMENDRA MARKANDE DURGA KURRE NARAYAN PRASAD TURKANE DR. TEN SINGH NAG TARUN KUMAR SAHU SUREKHA DHIVAR N.P. TURKANE SIR FAMILY RAVI NARAYAN SAY ITESH KUMAR SAHU RAVINDRA YADU OMESHWARI YADAV (MOHAN YADAV) JAYANTI DEWANGAN (DHANANJAY DEWANGAN HEMANT TARAM RAMESH KUMAR KASHYAP HEERALAL BELGAYA DEEPANJALI NAG (MEERA NAG) PANCH KUMAR SAHU RAGHUVEER BHANWAR DEVA LAHARI VERSHA SINGH NEERAJ MAM TRILOCHNI SAHU RISHI HIRWANI PRASHANT HARPAL RICHA PATRA AJAY SINGH LAHARI MAUNEE DEWANGAN PRATIBHA VERMA LALITA BELGAYA SANKHA BAI BAMLESHWARI DHRUW SONADHAR SHANK SUNITA SAMRATH / RAJKUMAR SAMRATH BHAGESHWARI NAG NAVSHEELA NAYAK RAJKUMARI PATEL KAMAL DAS MANIKPURI CHANDRA PRAKASH DANDEKAR MANISHA YADU ROSHNI BHAWAR PRASHANT YADAV TIJRAM LAHARI VEDVATI PATRA HEMLATA SINGH HEMIN LASEL JAGDISH LASEL RAJKUMARI KUMETI CHUNNI RAWTE HARIKIRTAN YADAV SEJAL NAG DEEPTI PAIKRA ANJANI PATEL MAMTA SINGH GHAN SHYAM PATRA DURGESHWARI NAVRANGE SAMBHOONATH DEHARI RISHI KUMAR DEEPANJALI NAG DINESH NIRMALKAR ROHIT DEWANGAN MAMTA THAKUR JITANSHU DHRUW SEVANTIN BAI TARAM MANKUVAR KOLA GIRENDRA SUDHAKAR RAVINDRA LAHARE GAJENDRA YADAV SHIV DAYAL SINGH NAVEEN KHOBRAGADE TARUN LATA SHANKH VIMLA THAKUR / NARAYAN THAKUR CHHAGAN LAL TARAM NAG SIR FAMILY PRABHA SINGH MANIRAM SAHU NARENDRA BHARADWAJ MR.YASHWANT KHUTE SIR PRITESH DASHHARE RAMA LASEL'),
