e the most important part of what we do as a team. Overseeing Research and Products development in the bioalexis, although Mr. Tarun Yadav enjoys the analytical aspect of his duties. His mission is to make Bioalexis company a Billion-dollar company by creating more and more Billionaires in the company. '),
